function Navbar() {
  return (
    // <nav className="navbar">
    <nav class="navbar navbar-expand-lg navbar-light fixed-top py-3" id="mainNav">
      {/* <h1>AggieSwap</h1> */}
      <div className="links">
        <a href="/">Home</a>
        <a href="/swap">Swap</a>
        <a href="/wallet">Wallet</a>
      </div>
    </nav>
  );
}

export default Navbar;
